import React from 'react';

const Projects = () => {
  const projects = [
    {
      id: 1, // Add unique identifier
      title: 'Web Development Project',
      description: 'Full-stack application using React and Node.js',
      technologies: ['React', 'Node.js', 'MongoDB']
    },
    {
      id: 2, // Add unique identifier
      title: 'Data Visualization Tool',
      description: 'Interactive dashboard for business analytics',
      technologies: ['D3.js', 'React', 'TypeScript']
    }
  ];

  return (
    <section className="container mx-auto px-4 mb-12">
      <h2 className="text-3xl font-bold text-gray-800 mb-6">Projects</h2>
      <div className="grid md:grid-cols-2 gap-6">
        {projects.map((project) => (
          <div 
            key={project.id} // Use unique identifier instead of index
            className="bg-white border border-gray-200 rounded-lg overflow-hidden 
                       shadow-md hover:shadow-xl transition-all duration-300 ease-in-out"
          >
            <div className="p-6">
              <h3 className="text-2xl font-semibold text-gray-900 mb-3">
                {project.title}
              </h3>
              <p className="text-gray-600 mb-4">{project.description}</p>
              <div className="flex flex-wrap gap-2">
                {project.technologies.map((tech) => (
                  <span 
                    key={tech} 
                    className="bg-blue-100 text-blue-800 px-3 py-1 
                               rounded-full text-sm font-medium"
                  >
                    {tech}
                  </span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
